window.bookSummaryJSON = "<p><b>Winner of the Gold Science &amp; Technology trophy at the 2020 New York Festivals Radio Awards</b></p> <p>The 1960s space race captured our imaginations and our dreams. Today’s efforts to revitalize and expand space travel is being driven not just by government agencies such as NASA, but also by visionaries such as Richard Branson (Virgin Galactic), Elon Musk (SpaceX), and Jeff Bezos (Blue Origin).</p> <p>To celebrate the 50th anniversary of the 1969 moon landing, this major documentary-drama series brings to life the past, present, and future of man’s exploration of space. Between 1969 and 1972, twelve Americans walked on the moon. You’ll get to experience the thrill of that era and much, much more.</p> <p>Narrated by Kate Mulgrew (Emmy Award and Golden Globe nominee for <i>Orange Is the New Black;</i> Obie Award winner for <i>Iphigenia 2.0);</i> TV: <i>Star Trek: Voyager,</i> film: <i>Star Trek: Nemesis)</i>, <i>The Space Race</i> uses actual audio, original interviews, dramatic reconstructions, and first-hand accounts to tell the story of mankind’s first amazing steps off our world and onto the lunar surface.</p> <p>With unprecedented access, <i>The Space Race</i> takes listeners to Virgin Galactic’s space program in the Mojave Desert, features conversations with Buzz Aldrin, Gene Cernan, Sergei Krikalev, Tim Peake, and numerous key players at mission control. This Audible Original and takes you behind the scenes to see how these exciting adventures in outer space came to be.&nbsp;</p>"; 
